import { useEffect, useState } from 'react';
import './App.css';
// import Todo from './components/todo';

function App() {
  const [todos,setTodos]=useState()

  useEffect(()=>{
    const url = 'https://jsonplaceholder.typicode.com/todos';

    fetch(url)
    .then((res)=> res.json())
    .then((data)=> {
    console.log(data)
    setTodos(data)
  })
  },[]);

  return (
    <div className="container">
      {/* <Todo /> */}
      {todos && todos.map((todo)=>{
        return(
          <ul key={todo.id}>
            <li>{todo.title}</li>
          </ul>
        )
      })}


    </div>
  );
}

export default App;
